The QUEEN OF WANDS embodies the feminine power of the fire element. She stands for self-confidence, self-determination, for a catlike grace, the expression of her intelligence, and the ability to be flexible.
.
On the level of consciousness, this card means that we open ourselves to a power in life that supports warmth and lightheartedness as well as COURAGE and INITIATIVE in us. 
.
It says we must no longer let ourselves be driven by meager practical considerations or float without a will.
.
It shows the willingness to actively create our own lives and live them according to our ideals. 
.
In this context, it means an increase in wisdom of life, independence, and a refined sense of justice.
.
