‚ôãÔ∏è
Because the sun and the moon control one sign each, an unbalanced situation is created in each of these months. This imbalance causes the crab, the symbol for the month of Tammuz, to walk sideways rather than forward and backward. This also gives the month of Tammuz the opening for Cancer to begin, and it is the only month that is named after a disease.
‚ôãÔ∏è
On the seventeenth day of Tammuz, Moses came down form Mount Sinai with the Tablets, bringing to the world the power and energy of immortality. However, the Israelites and the mixed multitude were waited impatiently for Moses to come down from Mount Sinai and built the Golden Calf, the sight of which caused Moses to shatter the Tablets. 
‚ôãÔ∏è
This moment was marked by a clashing of two energies: the power of immortality and chaos with suffering, depression and death.  The historical fact that the walls were broken on the seventeenth of Tammuz was simply a manifestation of the incompatibility between the potential of the spiritual vessel and the reality of desire to receive for oneself alone.  If we do not make an effort to "love our neighbor as ourselves", we are essentially choosing the Golden Calf, and similarly, we cause our own walls to break down and begin destruction in various aspects of our lives.
‚ôãÔ∏è
Sartan (English: Cancer), in Aramaic is made up of two parts: Sar - to remove and clean all the negativity, andTan - chaos, hatred, animosity and any aspect of negativity. The power of the month of Cancer is to remove any problems or negative situations in our lives that might cause this disease to come to our lives.
‚ôãÔ∏è
The moon is unlike any other celestial body, as it changes its position each day, but remains visible nonetheless. It begins each lunar month as a thin scythe and reaches its fullest brightness on the fifteenth. From the moment that the fifteenth day is over, the light of the moon begins to wane, and this cycle repeats itself each month.
